import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, Link, Navigate } from "react-router-dom";
import usersList from "./pages/UsersList";
import PeopleManagement from "./pages/PeopleManagement";
import AssetManagement from "./pages/AssetManagement";
import InventoryRecords from "./pages/InventoryRecords";
import Reports from "./pages/Reports";
import Settings from "./pages/Settings";
import Login from "./pages/Login";

const AppContent = ({ isAuthenticated, setIsAuthenticated }) => {
  const handleLogout = () => {
    localStorage.removeItem("access_token");
    localStorage.removeItem("refresh_token");
    localStorage.removeItem("user");
    setIsAuthenticated(false);
  };

  return (
    <div style={{ padding: "20px" }}>
      {isAuthenticated && (
        <nav style={{ marginBottom: "20px" }}>
          <Link to="/">üè† È¶ñÈ†Å</Link> |{" "}
          <Link to="/users">üë• ‰∫∫Âì°ÁÆ°ÁêÜ</Link> |{" "}
          <Link to="/assets">üíº Ë≥áÁî¢ÁÆ°ÁêÜ</Link> |{" "}
          <Link to="/inventory">üì¶ Âá∫ÂÖ•Â∫´Á¥ÄÈåÑ</Link> |{" "}
          <Link to="/reports">üìä Â†±Ë°®</Link> |{" "}
          <Link to="/settings">‚öôÔ∏è Á≥ªÁµ±Ë®≠ÂÆö</Link> |{" "}
          <button onClick={handleLogout} style={{ marginLeft: "10px" }}>
            ÁôªÂá∫
          </button>
        </nav>
      )}

      <Routes>
        <Route
          path="/"
          element={isAuthenticated ? <h1>Ë≥áÁî¢ÁÆ°ÁêÜÁ≥ªÁµ±È¶ñÈ†Å</h1> : <Navigate to="/login" replace />}
        />
        <Route
          path="/users"
          element={isAuthenticated ? <UsersList /> : <Navigate to="/login" replace />}
        />
        <Route
          path="/users"
          element={isAuthenticated ? <PeopleManagement /> : <Navigate to="/login" replace />}
        />
        <Route
          path="/assets"
          element={isAuthenticated ? <AssetManagement /> : <Navigate to="/login" replace />}
        />
        <Route
          path="/inventory"
          element={isAuthenticated ? <InventoryRecords /> : <Navigate to="/login" replace />}
        />
        <Route
          path="/reports"
          element={isAuthenticated ? <Reports /> : <Navigate to="/login" replace />}
        />
        <Route
          path="/settings"
          element={isAuthenticated ? <Settings /> : <Navigate to="/login" replace />}
        />
        <Route path="/login" element={<Login onLogin={() => setIsAuthenticated(true)} />} />
      </Routes>
    </div>
  );
};

const App = () => {
  const [isAuthenticated, setIsAuthenticated] = useState(!!localStorage.getItem("access_token"));

  return (
    <Router>
      <AppContent isAuthenticated={isAuthenticated} setIsAuthenticated={setIsAuthenticated} />
    </Router>
  );
};

export default App;
